CREATE TABLE `tblOmsAccountInfo` (
    `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
    `uid` bigint(20) unsigned NOT NULL COMMENT '账户uid',
    `puid` bigint(20) unsigned NOT NULL COMMENT '账户puid',
    `identity` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '身份，1-内部运营，2-外部代理商',
    `org_id` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '用户所属机构id（代理商有值，运营为空）',
    `org_type` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '机构类型，1-代理商',
    `name` varchar(128) NOT NULL DEFAULT '' COMMENT '姓名',
    `pinyin` varchar(128) NOT NULL DEFAULT '' COMMENT '全拼',
    `status` tinyint(2) unsigned NOT NULL DEFAULT '0' COMMENT '0-启用，1-停用',
    `create_uid` bigint(20) unsigned NOT NULL COMMENT '账号创建人',
    `op_uid` bigint(20) unsigned NOT NULL COMMENT '最后修改人',
    `created_at` datetime(3) NOT NULL COMMENT '创建时间',
    `updated_at` datetime(3) NOT NULL COMMENT '最后更新时间',
    `deleted_at` datetime(3) DEFAULT NULL COMMENT '删除时间',
    PRIMARY KEY (`id`),
    KEY `idx_uid` (`uid`),
    KEY `idx_puid` (`puid`),
    KEY `idx_name` (`name`),
    KEY `idx_pinyin` (`pinyin`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 COMMENT='运营管理系统账号信息表';

